angular.module('app.controllers')
    .controller('registrarChamado6Ctrl', function($scope, CitizenService, UnsolvedCallService, $cordovaCamera, $http, $cordovaImagePicker, MobileFactory, UserService, $state, IpService, $ionicPopup, AnonymousService, $ionicHistory, $ionicLoading) {

        var url = IpService.getIp();

        $scope.unsolvedCall = UnsolvedCallService.getUnsolvedCall();
        $scope.unsolvedCall.mediasPath = new Array();
        $scope.collection = {
            selectedImage: ''
        };

        var token;
        var user;
        if (AnonymousService.getAnonymous() == 1) {
            var token = window.localStorage.getItem("token");
            if (token == null)
                token = "z";
            var user = UserService.getUser().userID;
            if (user != undefined) {
                $scope.unsolvedCall.citizenCpf = {
                    'facebookId': user
                };
            }
        } else
            token = "z";
        var imgCounter = 0; //para saber a quantidade de imagens que foi inserido



        var img = "";
        var imgZEM = "";
        $scope.unsolvedCall.mediasPath.push(img);
        $scope.unsolvedCall.mediasPath.push(img);
        $scope.unsolvedCall.mediasPath.push(img);

        //função de pegar imagem da galeria
        $scope.getGallery = function() {
            var options = {
                maximumImagesCount: 1, // Max number of selected images, I'm using only one for this example
                width: 500,
                height: 500,
                quality: 80 // Higher is better
            };
            // pick
            $cordovaImagePicker.getPictures(options).then(function(results) {
                var imgData = results[0];
                // convert image to base64 string
                window.plugins.Base64.encodeFile(imgData, function(base64) { // Encode URI to Base64 needed for contacts plugin
                    $scope.unsolvedCall.mediasPath.pop(); //remove a ultima imagem do array
                    $scope.unsolvedCall.mediasPath.unshift(base64); //insere uma imagem no inicio do array
                    //$scope.$digest();
                    imgCounter++;
                    //console.log(imgCounter);
                    //console.log('Image URI base64: ' + imgData); // Print image URI
                    //console.log('Image URI base64: ' + base64); // Print image URI
                });
            });
        };

        $scope.getGallery2 = function() {
            if (imgCounter < 3) {
                // pick
                var options = {
                    quality: 100,
                    targetHeight: 500,
                    targetWidth: 500,
                    destinationType: Camera.DestinationType.DATA_URL,
                    sourceType: Camera.PictureSourceType.PHOTOLIBRARY,
                    encodingType: Camera.EncodingType.PNG,
                };

                $cordovaCamera.getPicture(options).then(function(imageData) {
                    //console.log('Image URI base64: ' + imageData); // Print image URI
                    $scope.unsolvedCall.mediasPath.pop(); //remove a ultima imagem do array
                    $scope.unsolvedCall.mediasPath.unshift(imageData); //insere uma imagem no inicio do array
                    imgCounter++;
                    //$scope.$digest();
                    //console.log(imgCounter);
                }, function(err) {
                    console.log("erro");
                });
            } else {
                //informar o usuario que não e possivel inserir mais de 3 imagens
                var alertPopup = $ionicPopup.alert({
                    title: 'Atenção!',
                    template: 'Não é possível inserir mais do que 3 imagens.',
                    okType: 'button-zem'
                });
            }
        }

        //função de tirar foto
        $scope.getCamera = function() {
            if (imgCounter < 3) {
                var options = {
                    quality: 80,
                    targetHeight: 500,
                    targetWidth: 500,
                    destinationType: Camera.DestinationType.DATA_URL,
                    sourceType: Camera.PictureSourceType.CAMERA,
                    allowEdit: false,
                    encodingType: Camera.EncodingType.JPG,
                    popoverOptions: CameraPopoverOptions,
                    saveToPhotoAlbum: false,
                    correctOrientation: true,
                    //allowEdit : true,
                };
                $cordovaCamera.getPicture(options).then(function(imageData) {
                    //console.log('Image URI base64: ' + imageData); // Print image URI
                    $scope.unsolvedCall.mediasPath.pop(); //remove a ultima imagem do array
                    $scope.unsolvedCall.mediasPath.unshift(imageData); //insere uma imagem no inicio do array
                    imgCounter++;
                    //console.log(imgCounter);
                }, function(err) {
                    console.log("erro");
                });
            } else {
                //informar o usuario que não e possivel inserir mais de 3 imagens
                var alertPopup = $ionicPopup.alert({
                    title: 'Atenção!',
                    template: 'Não é possível inserir mais do que 3 imagens.',
                    okType: 'button-zem'
                });
            }
        }
        $scope.verifyToken = function() {
            //console.log("OK");
            var token = window.localStorage.getItem("token");
            $http.get(url + "/token/" + token).success(function(data) {
                if (data.code === "1") {
                    //console.log("O Token e valido");
                    saveCall();
                    $state.go('detalhamentoChamado');
                }
            }).error(function() {
                alert("E necessario autenticar novamente");
                //solicitar o login novamente sem perder as informações
            });
        };

        function removeArrValue(arr, value) {
            var index = arr.indexOf(value);
            if (index > -1) {
                arr.splice(index, 1);
            }
            return arr;
        }

        $scope.remove = function(img) {
            removeArrValue($scope.unsolvedCall.mediasPath, img); //remove a imagem selecionada
            $scope.unsolvedCall.mediasPath.push(imgZEM); //insere uma imagem no final do arrat
            imgCounter--;
            //console.log(imgCounter);
        }

        $scope.saveCall = function(form) {
            //iniciar animação de loading
            $ionicLoading.show({
                content: 'Loading',
                animation: 'fade-in',
                showBackdrop: true,
                maxWidth: 200,
                showDelay: 0
            });

            if (form.$valid) {
                //removendo as imagens com a logo do souZem
                if (imgCounter === 0) {
                    $scope.unsolvedCall.mediasPath.pop();
                    $scope.unsolvedCall.mediasPath.pop();
                    $scope.unsolvedCall.mediasPath.pop();
                } else if (imgCounter === 1) {
                    $scope.unsolvedCall.mediasPath.pop();
                    $scope.unsolvedCall.mediasPath.pop();
                } else if (imgCounter == 2) {
                    $scope.unsolvedCall.mediasPath.pop();
                }
                //console.log($scope.unsolvedCall);
                MobileFactory.saveUnsolvedCall($scope.unsolvedCall, token).then(function mySucces(response) {
                    //console.log("Chamado cadastrado com sucesso ");
                    //console.log(response);
                    UnsolvedCallService.setUnsolvedCall(response);
                    $scope.unsolvedCall = {
                        'callClassificationId': null,
                        'description': {
                            'information': null
                        },
                        'entityEntityCategoryMaps': null,
                        'addressId': {
                            'neighborhoodId': null
                        },
                        'callStatus': 0,
                        'anonymity': 1,
                        'mediasPath': null
                    };
                    imgCounter = 0;
                    var user = UserService.getUser().userID;
                    var token = window.localStorage.getItem("token");
                    if (user == undefined && token == null) {
                        //limpar o cache e bloquear o back
                        $ionicHistory.clearCache();
                        $ionicHistory.nextViewOptions({
                            disableBack: true
                        });
                        $ionicLoading.hide();
                        $state.go('zEMZeladoriaMunicipal');
                    } else {
                        //limpar o cache e bloquear o back
                        $ionicHistory.clearCache();
                        $ionicHistory.nextViewOptions({
                            disableBack: true
                        });
                        $ionicLoading.hide();
                        $state.go('detalhamentoChamado');
                    }
                }, function myError(response) {
                    $ionicLoading.hide();
                    //console.log("Erro ao cadastrar chamado");
                    $ionicPopup.alert({
                        title: 'Erro',
                        template: 'Não foi possível registrar o chamado. Tente novamente mais tarde.',
                        okType: 'button-zem',
                    });
                    if (user == undefined && token == null) {
                        //limpar o cache e bloquear o back
                        $ionicHistory.clearCache();
                        $ionicHistory.nextViewOptions({
                            disableBack: true
                        });
                        $ionicLoading.hide();
                        $state.go('zEMZeladoriaMunicipal');
                    } else {
                        //limpar o cache e bloquear o back
                        $ionicHistory.clearCache();
                        $ionicHistory.nextViewOptions({
                            disableBack: true
                        });
                        $ionicLoading.hide();
                        $state.go('mainPage');
                    }
                });
            } else {
                $scope.enviado = true;
                $ionicLoading.hide();
            }
        }
    });